Go try out Honkai: Star Rail!: https://hoyo.link/ZVyKtnt91
CODE: ABC1GHIJ4567

In this video I added a ton of awful enchantments just to see how far we can go. All enchantments are a spin-off on @Knarfy's enchantments, where they will either be way better, or way worse.

By the way, the jokes to Knarfy are completely satirical and not genuine, I love the guy and we both had a lot of fun being in each other's videos :) 

This video was a lot of fun to record and I really hope you enjoy it, there's tons of stuff that happened and we struggled to edit it down to a half-hour-long video haha

